import React from 'react';
import ToDo from './todo.js';



export default function toDoList ({lists, setLists}){


    return (
      <ul>
        {lists.list.map(item => (
          <li
            className={`complete-${item.complete.toString()}`}
            key={item._id}
          >
            <span onClick={() =>lists.handleComplete(item._id)}>
              {item.text}
            </span>
          </li>
        ))}
      </ul>
    );
  }


